n":{"iopub.execute_input":"2024-03-19T14:11:31.418849Z","iopub.status.busy":"2024-03-19T14:11:31.415858Z","iopub.status.idle":"2024-03-19T14:11:31.565905Z","shell.execute_reply":"2024-03-19T14:11:31.563901Z"},"papermill":{"duration":0.165687,"end_time":"2024-03-19T14:11:31.569394","exception":false,"start_time":"2024-03-19T14:11:31.403707","status":"completed"},"tags":[]},"outputs":[],"source":["x <- c(0.05, 0.10)\n","y <- c(0.01, 0.99)\n","\n","x <- t(matrix(x))\n","y <- t(matrix(y))"]},{"cell_type":"markdown","id":"a2ffabee","metadata":{"papermill":{"duration":0.009628,"end_time":"2024-03-19T14:11:31.588395","exception":false,"start_time":"2024-03-19T14:11:31.578767","status":"completed"},"tags":[]},"source":["## Create Function"]},{"cell_type":"code","execution_count":2,"id":"d938a181","metadata":{"execution":{"iopub.execute_input":"2024-03-19T14:11:31.649616Z","iopub.status.busy":"2024-03-19T14:11:31.614763Z","iopub.status.idle":"2024-03-19T14:11:31.680365Z","shell.execute_reply":"2024-03-19T14:11:31.678439Z"},"papermill":{"duration":0.086107,"end_time":"2024-03-19T14:11:31.68387","exception":false,"start_time":"2024-03-19T14:11:31.597763","status":"completed"},"tags":[]},"outputs":[],"source":["# inisialisasi parameter\n","init_params <- function(){\n","  W1 <- matrix(c(0.15, 0.25, 0.20, 0.30), nrow=2, ncol=2, byrow=T)\n","  b1 <- matrix(c(0.35, 0.35), nrow=1, ncol=2, byrow=T)\n","  W2 <- matrix(c(0.40, 0.45, 0.50, 0.55), nrow=2, ncol=2, byrow=T)\n","  b2 <- matrix(c(0.60, 0.60), nrow=1, ncol=2, byrow=T)\n","  return(list(\"W1\"=W1, \"b1\"=b1, \"W2\"=W2, \"b2\"=b2))\n","}\n","\n","# fungsi aktivasi\n","sigmoid <- function(z){\n","  result <- 1/(1+exp(-z))\n","  return(result)\n","}\n","\n","# forward propagation\n","forward_prop <- function(W1, b1, W2, b2, x){\n","  Z1 <- x %*% W1 + b1\n","  A1 <- sigmoid(Z1)\n","  Z2 <- A1 %*% W2 + b2\n","  A2 <- sigmoid(Z2)\n","  return(list(\"Z1\"=Z1, \"A1\"=A1, \"Z2\"=Z2, \"A2\"=A2))\n","}\n","\n","# loss function, menggunakan Half Sum Square Error\n","error <- function(y, A2){\n","  er <- 1/2 * sum((y - A2)^2)\n","  return(er)\n","}\n","\n","# back Propagation\n","back_prop <- function(Z1, A1, Z2, A2, W2, x, y){\n","  dW2 <- t(t(-(y - A2) * A2 * (1-A2)) %*% A1)\n","  db2 <- -(y - A2) * A2 * (1-A2)\n","  dW1 <- t((t((-(y-A2) * A2 *(1-A2)) %*% t(W2)) * t(A1*(1-A1))) %*% x )\n","  db1 <- t(t((-(y-A2) * A2 *(1-A2)) %*% t(W2)) * t(A1*(1-A1)))\n","  return(list(\"dW1\"=dW1, \"db1\"=db1, \"dW2\"=dW2, \"db2\"=db2))\n","}\n","\n","# update parameter / optimizer, dengan menggunakan Gradient Descent\n","gradien_desc <- function(W1, b1, W2, b2, dW1, db1, dW2, db2, l_r){\n","  W1 <- W1 - l_r * dW1\n","  b1 <- b1 - l_r * db1\n","  W2 <- W2 - l_r * dW2\n","  b2 <- b2 - l_r * db2\n","  return(list(\"W1\"=W1, \"b1\"=b1, \"W2\"=W2, \"b2\"=b2))\n","}"]},{"cell_type":"markdown","id":"698bcf19","metadata":{"papermill":{"duration":0.009616,"end_time":"2024-03-19T14:11:31.703325","exception":false,"start_time":"2024-03-19T14:11:31.693709","status":"completed"},"tags":[]},"source":["## Modelling"]},{"cell_type":"code","execution_count":3,"id":"68f5d858","metadata":{"execution":{"iopub.execute_input":"2024-03-19T14:11:31.727196Z","iopub.status.busy":"2024-03-19T14:11:31.725509Z","iopub.status.idle":"2024-03-19T14:11:31.741407Z","shell.execute_reply":"2024-03-19T14:11:31.739598Z"},"papermill":{"duration":0.031686,"end_time":"2024-03-19T14:11:31.744635","exception":false,"start_time":"2024-03-19T14:11:31.712949","status":"completed"},"tags":[]},"outputs":[],"source":["model_fit <- function(x, y, iterations, step_per_epoch=1, l_r){\n","  list_error <- c()\n","  p <- init_params()\n","  for( i in 1:iterations){\n","    f_p <- forward_prop(p$W1, p$b1, p$W2, p$b2, x)\n","    b_p <- back_prop(f_p$Z1, f_p$A1, f_p$Z2, f_p$A2, p$W2, x, y)\n","    p <- gradien_desc(p$W1, p$b1, p$W2, p$b2, b_p$dW1, b_p$db1, b_p$dW2, b_p$db2, l_r = l_r)\n","    \n","    list_error[i] <- error(y, f_p$A2)\n","    \n","    if( i %% step_per_epoch == 0){\n","      cat('\\nepoch    : ', i/step_per_epoch, ' | iteration : ', i)\n","      cat('\\ny actual : ', y)\n","      cat('\\npredict  : ', f_p$A2)\n","      cat('\\nerror    : ', list_error[i], '\\n')\n","    }\n","  }\n","  plot(list_error, type = 'o', xlab='iterasi', ylab='error', main='Error Plot')\n","  return(list(\"W1\"=p$W1, \"b1\"=p$b1, \"W2\"=p$W2, \"b2\"=p$b2))\n","}"]},{"cell_type":"code","execution_count":4,"id":"e802b99d","metadata":{"execution":{"iopub.execute_input":"2024-03-19T14:11:31.768056Z","iopub.status.busy":"2024-03-19T14:11:31.766293Z","iopub.status.idle":"2024-03-19T14:11:33.315582Z","shell.execute_reply":"2024-03-19T14:11:33.312719Z"},"papermill":{"duration":1.564623,"end_time":"2024-03-19T14:11:33.318812","exception":false,"start_time":"2024-03-19T14:11:31.754189","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n","epoch    :  1  | iteration :  1000\n","y actual :  0.01 0.99\n","predict  :  0.01068533 0.9893428\n","error    :  4.508045e-07 \n","\n","epoch    :  2  | iteration :  2000\n","y actual :  0.01 0.99\n","predict  :  0.01009386 0.9899134\n","error    :  8.157048e-09 \n","\n","epoch    :  3  | iteration :  3000\n","y actual :  0.01 0.99\n","predict  :  0.01001417 0.9899876\n","error    :  1.7709e-10 \n","\n","epoch    :  4  | iteration :  4000\n","y actual :  0.01 0.99\n","predict  :  0.01000218 0.9899982\n","error    :  3.956571e-12 \n","\n","epoch    :  5  | iteration :  5000\n","y actual :  0.01 0.99\n","predict  :  0.01000034 0.9899997\n","error    :  8.933602e-14 \n","\n","epoch    :  6  | iteration :  6000\n","y actual :  0.01 0.99\n","predict  :  0.01000005 0.99\n","error    :  2.042204e-15 \n","\n","epoch    :  7  | iteration :  7000\n","y actual :  0.01 0.99\n","predict  :  0.01000001 0.99\n","error    :  4.761818e-17 \n","\n","epoch    :  8  | iteration :  8000\n","y actual :  0.01 0.99\n","predict  :  0.01 0.99\n","error    :  1.145993e-18 \n","\n","epoch    :  9